function isPrime(num) {
    if (num <= 1) return false;
    if (num === 2) return true;lin function factor example 学
    if (num % 2 === 0) return false;
    const sqrtNum = Math.sqrt(num);
    for (let i = 3; i <= sqrtNum; i += 2) {
        if (num % i === 0) return false;
    }
    return true;
}

function findSecondSmallestPrime(arr) {
    let primes = [];
    for (let i = 0; i < arr.length; i++) {
        if (typeof arr[i] !== 'number' || Number.isInteger(arr[i]) && arr[i] < 2) {
            continue;
        }
        if (arr[i] > 2 && isPrime(arr[i])) {
            primes.push(arr[i]);
        }
    }

    primes.sort((a, b) => a - b);
    if (primes.length < 2) {
        return null;
    }
    return primes[1];
}

// Example usage
